import React from 'react';
import TopSpace from '../components/common/TopSpace';
import PostViewerContainer from '../containers/post/PostViewerContainer';
import styled from 'styled-components';
import BottomInfo from '../components/common/BottomInfo';
import HeaderWithHamburger from '../components/common/HeaderWithHamburger';

const Spacer = styled.div`
  height: 2rem;
`;

const PostPrizedPage = () => {
  return (
    <>
      <HeaderWithHamburger />
      <Spacer />
      <TopSpace title="수상 목록" description="해당 대회의 수상 목록" />
      <PostViewerContainer />
      <p>asdfasdf</p>
      <BottomInfo />
    </>
  );
};

export default PostPrizedPage;
